import React from 'react';

class FileManagement extends React.Component{
    constructor(props){
        super(props);
        this.onFileSelected = this.onFileSelected.bind(this);

        //Request file list to back-end
        //fetch("/files");

        this.state = {
            fileList: ["intan_save_210107_151441.rhs"],
            selectedFile: ""
        };
    }

    componentDidMount() {
    }

    onFileSelected (){
        var selected = document.getElementById("fileList").value;

        if (selected === this.state.selectedFile)
            return;

        this.props.history.push('/viewer/' + selected);
    }

    render(){
        var options = [];
        for (var i = 0; i < this.state.fileList.length; i++){
             options.push(
                 <option key={i} value={this.state.fileList[i]}>{this.state.fileList[i]}</option>
             )
        }

        return (
        <div className="container">
            파이이이이ㅣㅣㅣ이이이ㅣ리ㅣ이이이ㅣㅣ이이ㅣ이이이이이이ㅣ이이ㅣㅣㄹ
            <select id="fileList" className="form-select"  onDoubleClick={this.onFileSelected} multiple>
                {options}
            </select>
        </div>);
    }
}

export default FileManagement;
